import React from "react";
import { BrowserRouter as Router, Switch, Route, Link } from "react-router-dom";
import "./style.scss";

function Project({ className, title, desc, image }) {
	return (
		<Link to="/hult-edu">
			<div className={`project ${className}`}>
				<p>{title}</p>
			</div>
		</Link>
	);
}

export default Project;
